import Mockps from '../public/media/mockups.svg';

const Header = () => {
    return (
        <header className={'mt-5'}>
            <div class="container">
                <div className="row">
                    <div className={"col-6"}>
                        p test
                    </div>
                    <div className={'col-6'}>
                        <img src={Mockps}/>
                    </div>
                </div>
            </div>
        </header>
    )
}

export default Header;
